import { actionTypes } from '../actions/user-info-actions'

function userInfoReducer(state,action){
    switch(action.type){
        case actionTypes.HISTORY_LIST:
            return Object.assign(
                {},
                state,
                {
                    username:action.username
                }
            );
        default:
            return state;
    }
}

export default userInfoReducer;
